import { Component, ElementRef, OnInit, ViewChild } from '@angular/core';
import { ImageCroppedEvent } from 'ngx-image-cropper';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  imageB64: string = "";
  imageUrl: string = "data:image/jpeg;base64," + this.imageB64;
  croppedImage: any = '';
  @ViewChild('imageOriginal')
  el!: ElementRef;
  // resizeToWidth: number = 0;

  ngOnInit(): void {
    this.getFileSize(this.imageUrl, "imagen original");
  }

  imageCropped(event: ImageCroppedEvent) {
    this.croppedImage = event.base64;
    

    // const width = this.el.nativeElement.width - 300;

    // console.log(width);
    // this.resizeToWidth = width ;

    this.getFileSize(this.croppedImage, "imagen recortada");
  }

  getFileSize(url: string, filename: string) {
    fetch(url)
      .then(res => res.blob())
      .then(blob => {
        const file = new File([blob], filename, { type: "image/jpeg" })
        console.log(file);
      })
  }
}
